Given the equation \( z + \frac{1}{z} = \frac{1 + \sqrt{5}}{2} \), we recognize that the right-hand side is the golden ratio, which is denoted by \(\phi\). Therefore, we can write:

\[ z + \frac{1}{z} = \phi. \]

The golden ratio satisfies the equation \(\phi^2 = \phi + 1\). To find the possible values of \(z\), we multiply both sides of the equation \( z + \frac{1}{z} = \phi \) by \(z\):

\[ z^2 + 1 = \phi z. \]

Rearranging terms, we get a quadratic equation:

\[ z^2 - \phi z + 1 = 0. \]

We solve this quadratic equation using the quadratic formula \( z = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a} \), where \(a = 1\), \(b = -\phi\), and \(c = 1\):

\[ z = \frac{\phi \pm \sqrt{\phi^2 - 4 \cdot 1 \cdot 1}}{2 \cdot 1} = \frac{\phi \pm \sqrt{\phi + 1 - 4}}{2} = \frac{\phi \pm \sqrt{\phi - 3}}{2}. \]

Since \(\phi = \frac{1 + \sqrt{5}}{2}\), we substitute this value into the expression:

